// MenuList.js
import React from 'react';
import MenuItem from './MenuItem';

const MenuList = ({ items }) => {
  return (
    <section>
      {items.map((item) => (
        <MenuItem key={item.id} {...item} />
      ))}
    </section>
  );
};

export default MenuList;
